def isClassFile(file):
    '''
    Returns True if the file handle is referencing a file that is a
    Java class file.  Returns False otherwise.
    '''
    magic = file.read(4)
    if len(magic) != 4:
        return False

    if magic[0] != 0xCA or magic[1] != 0xFE or magic[2] != 0xBA or magic[3] != 0xBE:
       return False
    return True

