class SysPackages:

    # RPM: rpm -qal --files-bypkg -> pkg filename
    # DPKG: dpkg -S 'glob'  ->  pkg: filename
    #
    @staticmethod
    def getFileNames(patterns):
        isDPKG=False
        isRPM=False
        isLPP=False
        cmd=None
        pkgtype=None
        if os.path.exists("/usr/bin/lslpp"):
            isLPP=True
            pkgtype='lpp'
            cmd=["/usr/bin/lslpp", "-f", "-c"]
        elif os.path.exists("/usr/bin/dpkg"):
            isDPKG=True
            pkgtype = 'deb'
            cmd=["/usr/bin/dpkg","-S","*"]
        elif os.path.exists("/usr/bin/rpm"):
            isRPM=True
            pkgtype='rpm'
            cmd=["/usr/bin/rpm", "-qal", "--files-bypkg"]
        else:
            return None

        if sys.version[0] == '3':
            p = subprocess.Popen(cmd, stdout=subprocess.PIPE, stderr=subprocess.DEVNULL)
        else:
            p = subprocess.Popen(cmd, stdout=subprocess.PIPE)
            
        lines=[]
        if sys.version[0] == '3':
            with io.TextIOWrapper(p.stdout, encoding="utf-8") as pin:
                for line in pin:
                    lines.append(line.strip())
        else:
            for line in p.stdout:
                lines.append(line.strip())

        result = {}
        result[pkgtype] = {}
        for rec in lines:
            if isDPKG:
                rec = rec.replace(':', ' ')
            while rec.find('  ') != -1:
                rec = rec.replace('  ',' ')
            if isLPP and rec[0] == '#':
                continue
            if isLPP:
                (pkg,file) = rec.split(':',2)[1:]
            else:
                (pkg,file) = rec.split(' ',1)
            for p in patterns:
                if re.search(p, file) is not None:
                    if pkg not in result[pkgtype]:
                        result[pkgtype][pkg] = []
                    result[pkgtype][pkg].append(file)
                    break

        if State.scanPython:
            pkgs={}
            for dir in ["/usr/bin", "/usr/local/bin"]:
                lines=[]
                for v in ["pip","pip2","pip3"]:
                    prog=dir+"/"+v
                    if not os.path.exists(prog):
                        continue
                    if sys.version[0] == '3':
                        p = subprocess.Popen([prog,'list','-v'],stdout=subprocess.PIPE, stderr=subprocess.DEVNULL)
                    else:
                        p = subprocess.Popen([prog,'list','-v'],stdout=subprocess.PIPE)

                    if sys.version[0] == '3':
                        with io.TextIOWrapper(p.stdout, encoding="utf-8") as pin:
                            for line in pin:
                                lines.append([prog,line.rstrip()])
                    else:
                        for line in p.stdout:
                            lines.append([prog,line.rstrip()])
                needLoc={}
                candidates=[]
                for prog,line in lines:
                    if line.startswith("Package") or line.startswith("----"):
                        continue
                    line = line.replace("(", "")
                    line = line.replace(")", "")
                    while line.find("  ") != -1:
                        line = line.replace("  "," ")
                    fields = line.split(" ")
                    if len(fields) > 2:
                        name,version,location, = fields[0:3]
                        candidates.append([name,version,location])
                    else:
                        name, version = fields
                        if prog not in needLoc:
                            needLoc[prog] = []
                        needLoc[prog].append([name,version])
                for prog in needLoc:
                    pkgcmd = [prog,'show']
                    for x in needLoc[prog]:
                        pkgcmd.append(x[0])
                    if sys.version[0] == '3':
                        p = subprocess.Popen(cmd, stdout=subprocess.PIPE, stderr=subprocess.DEVNULL)
                    else:
                        p = subprocess.Popen(cmd, stdout=subprocess.PIPE)
                    data=[]
                    if sys.version[0] == '3':
                        with io.TextIOWrapper(p.stdout, encoding="utf-8") as pin:
                            for rec in pin:
                                data.append(rec.rstrip())
                    else:
                        for rec in p.stdout:
                            data.append(rec.rstrip())
                    name = None
                    version = None
                    location = None
                    for rec in data:
                        if rec.startswith("Name: "):
                            name = rec[6:]
                        elif rec.startswith("Version: "):
                            version = rec[9:]
                        elif rec.startswith("Location: "):
                            location=rec[10:]
                            break
                        elif rec.startswith("---"):
                            if name is not None and version is not None and location is not None:
                                candidates.append([name,version,location])
                                name = None
                                version = None
                                location = None
                for name,version,location in candidates:
                    fn = name.replace("-","_")
                    for pt, suffix in [["pip",".dist-info/METADATA"],
                                       ["egg",".egg-info/PKG-INFO"]]:
                        td = location+"/"+fn+"-"+version+suffix
                        if os.path.exists(td):
                            pkgs[td] = [name,pt]
                            break
            if len(pkgs) != 0:
                for p in pkgs:
                    [n,pt] = pkgs[p]
                    if pt not in result:
                        result[pt] = {}
                    if n not in result[pt]:
                        result[pt][n] = []
                    result[pt][n].append(p)

        return result
