class JarName(JarIdentifier):

    myname="jar-name"
    
    def __init__(self):
        self.regex_map = Configuration.get_analytic_data('jar-name')['identifiers']
        self.reported_bad = set()

    @classmethod
    def supported(cls):
        if Configuration.get_analytic_data(cls.myname):
            return True
        return False        

    @classmethod
    def initialize(cls):
        cls.config = Configuration.get_analytic_data('jar-name')
        if cls.config is None:
            return False
        cls.regex_map = cls.config['identifiers']
        return True
    
    def addClassFile(self,cf):
        return

    @classmethod
    def scansInputStream(cls):
        return False

    def addInputStream(self,streamIn):
        return streamIn

    def identify(self,inputHandle):
        name = inputHandle.getDisplay()
        res = False
        n = name.rfind("/")
        if n != -1:
            name = name[n+1:]
        name = name.lower()

        for rule in self.regex_map:
            regex = rule['regex']
            fmt = rule.get('format', '%1')

            try:
                m = re.match(regex, name)
            except Exception:
                if regex not in self.reported_bad:
                    sys.stderr.write("Malformed regular expression: {regex}\n")
                    self.reported_bad.add(regex)
                continue
            if m is None:
                continue
            pos = 0
            segments = [x for x in m.groups()]
            replacements = []
            for ndx,value in enumerate(segments,1):
                var = '%' + str(ndx)
                value = segments[ndx-1]
                pos = 0
                while True:
                    ndx = fmt.find(var, pos)
                    if ndx == -1:
                        break
                    replacements.append((value,ndx,ndx+len(var)))
                    pos = ndx + len(var)

            v = []
            pos = 0
            for value, start, end in replacements:
                v.append(fmt[pos:start])
                v.append(value)
                pos = end
            v = "".join(v)

            nv = Version(v, self.myname)
            if State.addEvidence:
                nv.addEvidence(self.myname, "Filename matched /"+regex+"/")
            inputHandle.addVersion(nv)
            res = True
            break
        
        return res

    @classmethod
    def getAnalyticName(cls):
        return cls.myname

    @classmethod
    def getBriefDescription(cls):
        return "Uses patterns to extract the version from the name of the jar file. This analytic is not robust against file renaming, and also can not detect when class files have been included directly in a larger project. Run-time performance score: 1.00x (baseline)."
