def printJSON(x):
    print(json.dumps(x,separators=(',',':')))

def printText(x):
    print(Report.toString(x))
    
def errorOccurred(s):
    if s is not None:
        sys.stderr.write(s+"\n")
    sys.exit(1)

if __name__ == '__main__':

    p = makeParser()
    args = vars(p.parse_args())

    try:
        if args['report']:
            main(args, lambda x: printText(x), lambda x: errorOccurred(x))
        else:
            main(args, lambda x: printJSON(x), lambda x: errorOccurred(x))
    except KeyboardInterrupt:
        sys.exit(1)

